}
atom-text-editor .find-result .region.region.region,
:host .find-result .region.region.region,
atom-text-editor .current-result .region.region.region,
:host .current-result .region.region.region {
  border-radius: 0px;
  background-color: rgba(235, 180, 71, 0.16);
  transition: border-color 0.4s;
}
atom-text-editor .find-result .region.region.region,
:host .find-result .region.region.region {
  border: 2px solid transparent;
}
atom-text-editor .current-result .region.region.region,
:host .current-result .region.region.region {
  border: 2px solid #ebb447;
  transition-duration: .1s;
}
atom-text-editor .gutter .line-number,
:host .gutter .line-number {
  color: #9aadb6;
  -webkit-font-smoothing: antialiased;
}
atom-text-editor .gutter .line-number.git-line-removed:before,
:host .gutter .line-number.git-line-removed:before {
  bottom: -3px;
}
atom-text-editor .gutter .line-number.git-line-removed:after,
:host .gutter .line-number.git-line-removed:after {
  content: "";
  position: absolute;
  left: 0px;
  bottom: 0px;
  width: 25px;
  border-bottom: 1px dotted rgba(224, 82, 82, 0.5);
  pointer-events: none;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  color: #246789;
  background-color: #e0e4e6;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  background-color: transparent;
}
